@Override
public void get(int docID, BytesRef result) {
  int ord = getOrd(docID);
  if (ord == -1) {
    result.bytes = BytesRef.EMPTY_BYTES;
    result.length = 0;
    result.offset = 0;
  } else {
    lookupOrd(ord, result);
  }
}

